// Login.js
// Login.js
import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import { handleError, handleSuccess } from '../utils/ReactToastify';
import '../utils/ReactToastifyCustom.css';
import '../utils/loading.css';

function Login() {
    const [loginInfo, setLoginInfo] = useState({ email: '', password: '' });
    const [loading, setLoading] = useState(false);
    const [loadingVisible, setLoadingVisible] = useState(false);
    const navigate = useNavigate();

    const handleChange = (e) => {
        const { name, value } = e.target;
        setLoginInfo({ ...loginInfo, [name]: value });
    }

    const handleLogin = async (e) => {
        e.preventDefault();
        setLoading(true);
        setLoadingVisible(true);

        try {
            const response = await fetch('http://localhost:8080/auth/login', {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify(loginInfo)
            });
            const result = await response.json();

            if (result.success) {
                handleSuccess(result.message);
                localStorage.setItem('token', result.accessToken);
                localStorage.setItem('refreshToken', result.refreshToken);
                localStorage.setItem('loggedInUser', result.name);

                setTimeout(() => {
                    setLoadingVisible(false);
                    navigate('/home');
                }, 500);
            } else {
                handleError(result.message);
                setLoadingVisible(false);
            }
        } catch (err) {
            handleError(err.message || 'An error occurred');
            setLoadingVisible(false);
        } finally {
            setLoading(false);
        }
    }

    return (
        <div className='container'>
            <img src='/app-icon.ico' alt='App Icon' className='app-icon' />
            <h1>Login</h1>
            <form onSubmit={handleLogin}>
                <div className='form-group'>
                    <input onChange={handleChange} type='email' name='email' placeholder='Enter your email...' value={loginInfo.email} />
                    <label>Email</label>
                </div>
                <div className='form-group'>
                    <input onChange={handleChange} type='password' name='password' placeholder='Enter your password...' value={loginInfo.password} />
                    <label>Password</label>
                </div>
                <button type='submit'>Login</button>
                <span>Doesn't have an account? <Link to="/signup">Signup</Link></span>
            </form>
            <ToastContainer />
            {loadingVisible && <div className='loading-overlay'><img src='/apple-loading.gif' alt='Loading...' className='loading-spinner' /></div>}
        </div>
    );
}
